import React from "react";
import Sidebar from "../SideBar/Sidebar";
import { Routes, Route } from "react-router-dom";
import "./dashboard.css";

import Villes from "../Components/Villes/Villes";

import Regions from "../Components/Regions/Regions";
import Offres from "../Components/Offres/Offres";
import Options from "../Components/Options/Options";

const Dashboard = () => {
  return (
    <div className="dashboard">
      <Sidebar />
      <div className="dashboard--content">
        {/* <Routes>
          <Route path="/home" element={<Offres />} />
          <Route path="/users" element={<Offres />} />
          <Route path="/cities" element={<Villes />} />
          <Route path="/regions" element={<Regions />} />
          <Route path="/offers" element={<Offres />} />
          <Route path="/options" element={<Options />} />
        </Routes> */}
        <Routes>
  <Route path="/" element={<Home />} /> {/* Ajoutez cette ligne pour g√©rer le chemin racine */}
  <Route path="/home" element={<Offres />} />
  <Route path="/users" element={<Offres />} />
  <Route path="/cities" element={<Villes />} />
  <Route path="/regions" element={<Regions />} />
  <Route path="/offers" element={<Offres />} />
  <Route path="/options" element={<Options />} />
</Routes>
      </div>
    </div>
  );
};

export default Dashboard;
